script: |
  super -f text -I q14002.spq | sort > q14002.out

inputs:
  - name: q14002.spq
    data: |
      SELECT - col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col1 * + + 75 * + col2 + col2 + - + col0 + - col2 / + col0 * 94 NOT IN ( + col2 ) AND NOT + - 58 < 78 + + 46 + col2;
  - name: tab1

outputs:
  - name: q14002.out
    data: |
